INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(279384, 'ruRU', 'Разрушительное соревнование Бур-босса', 'Разрушительное соревнование Бур-босса', 59888),
(279845, 'ruRU', 'Нет...', '', 59888),
(275804, 'ruRU', 'Да ты вообще представляешь, во сколько это обошлось? За такое я с тебя твою зеленую шкуру спущу, Газлоу!', '', 59888),
