(271175, 'ruRU', '', 'Нет... но... ведь было... так весело...', 59888),
(271159, 'ruRU', '', 'Моя прекрасная сумка! Ах ты!.. Я прикончу тебя, как прикончила Рензика!', 59888),
(268888, 'ruRU', 'Черная кровь принадлежит Галливиксу!', '', 59888),
(268887, 'ruRU', 'Ну уж нет, мы забираем ваш груз!', '', 59888),
(275706, 'ruRU', 'Потрясите косточками!', '', 59888),
(275703, 'ruRU', 'При какой температуре зажаривается мясо?', '', 59888),
(275100, 'ruRU', 'Моя очередь! Сотру их в порошок.', '', 59888),
(275029, 'ruRU', 'В лепешку расплющим!', '', 59888),
