(282252, 'ruRU', 'Быстрогонц, ваша честь. Я – общественный защитник Быстрогонц.', '', 59888),
(282250, 'ruRU', 'Я ничего не придумывал, ваша честь. Если суд позволит, я с радостью расскажу, откуда взялся этот нюанс, и...', '', 59888),
(282246, 'ruRU', 'Ваша честь! У Галаджио есть хозяин.', '', 59888),
(282244, 'ruRU', 'Никакой проблемы нет, ваша честь. Хозяин мертв. Казино надо выставить на торги в нашем аукционном доме!', '', 59888),
