(276966, 'ruRU', 'Еще он заминировал все здание суда взрывными крабами, ваша честь. Но они уже обезврежены благодаря |3-2($p).', '', 59888),
(276963, 'ruRU', 'Это же очевидно, ваша честь! Убийца не кто иной, как... $p!', '', 59888),
(276962, 'ruRU', 'Ваша честь! У нас появилось доказательство того, что убийца Роузбада Галливикса сейчас находится в зале суда!', '', 59888),
(280948, 'ruRU', '', 'Не хочешь заморить червячка? Или купить Крутня, которого можно унести домой? Только представь, какие с ним получатся снимки! И самое главное: он никому ничего не сломает и не разгромит ничью лавку!\n\nА то с этим раньше бывали проблемы...', 59888),
(280946, 'ruRU', 'До сих пор устраняю неполадки. От всей этой революции у меня голова кругом!\n\nПопробуешь мой подтягиватель лица? Он твою физиономию не просто освежит, а даже лучше сделает!', '', 59888),
(280940, 'ruRU', 'Так-так-так… Хочешь иметь со мной дело? Понимаю, никто не хочет довольствоваться малым. Но пока ничем не могу помочь, нос не дорос. Накопи деньжат, тогда и приходи.', '', 59888),
(280939, 'ruRU', 'Мы только что получили весточку с регистрации. Говорят, тебе и твоим друзьям можно проходить. Но... только если вы достаточно опытные. Одолейте Граб\'Зи, и я мигом отправлю вас в подсобки.\n\nСпасибо, что вы с друзьями продолжаете выбирать Галаджио. Даже если вы тут все громите!', '', 59888),
(280933, 'ruRU', 'Босс говорит, мне нельзя рассказывать незнакомцам про наше поддельное оружие. Потому что оно не настоящее, а туристы лучше покупают, когда думают, что все подлинное.\n\nТак что не говори никому, ладно? Особенно незнакомцам.', '', 59888),
(280080, 'ruRU', '<злобный крик>', '', 59888),
(279822, 'ruRU', '', 'Пока-пока! Счастливо!', 59888),
(275813, 'ruRU', 'Экий ворчун! Ты хочешь меня свергнуть или нет? Шевели ногами. Скоро увидимся.', '', 59888),
(275810, 'ruRU', 'И вы его не получите. Верно, Граб?', '', 59888),
(275777, 'ruRU', 'Эврика! Галливикс просто с ума сойдет, когда это увидит! Или не сойдет. Может, сначала надо как следует проверить товар?..', '', 59888),
(275539, 'ruRU', '', 'Ну вот! Только мне стало весело!', 59888),
(275363, 'ruRU', '', 'Вот и все!', 59888),
(275239, 'ruRU', 'Мы вернемся сразу... после пары сообщений!', '', 59888),
(269863, 'ruRU', '', 'Я, конечно, не торговая принцесса, но сделаю все ради будущего Нижней Шахты.', 59888);
