(2640, 'ruRU', 'Котел смерти', 'Мировая история знавала немало великих войн, но ни одна из них не была такой взрывной, как противостояние между гальванической гориллой Крутнем Живая Буря и раскаленным мехазавром Пламендо Неистовым. Сегодня эти два чемпиона разойдутся не на шутку, сражаясь в котле смерти. Их поединок грозит расколоть Нижнюю Шахту надвое! Примите участие в кровавой бойне или станьте позором для гоблинов.', 59888);
