(31438, 'ruRU', 'Раздел 29', '', 59888),
(30331, 'ruRU', 'Обзор', 'Пламендо и Крутень устраивают шоу для зрителей, разбрасывая |cFF2959D3|Hspell:473650|h[хламобомбы]|h|r и применяя к бойцам на арене |cFF2959D3|Hspell:473951|h[статический заряд]|h|r. \nКогда Пламендо и Крутень накапливают 100 ед. энергии, они совершают рывок друг к другу и начинается |cFF2959D3|Hspell:465833|h[столкновение колоссов]|h|r!', 59888),
(27555, 'ruRU', 'Лекари', '$bullet; Когда действие |cFF2959D3|Hspell:424739|h[Хаотической порчи]|h|r заканчивается, она взрывается и переходит на ближайшего игрока.\n$bullet;|cFF2959D3|Hspell:424739|h [Хаотическая порча]|h|r наносит среднее количество периодического урона текущей цели.\n$bullet;|cFF2959D3|Hspell:425052|h [Темная гравитация]|h|r наносит среднее количество урона всем игрокам, пока действует эффект.', 59888),
(30489, 'ruRU', 'Бойцы', '$bullet;|cFF2959D3|Hspell:465952|h[Большие бомбы с маленьким сюрпризом]|h|r и |cFF2959D3|Hspell:1214607|h[сногсшибательный взрыв]|h|r также вызывают срабатывание |cFF2959D3|Hspell:466158|h[сумки сапера]|h|r и |cFF2959D3|Hspell:1214755|h[перегруженных ракет]|h|r.\n$bullet;Побежденные техники из картеля Мрачных Минеров оставляют гигабомбы, которые взрываются спустя $1223905D., после чего происходит |cFF2959D3|Hspell:1223905|h[ГигаБУМ!]|h|r. |cFF2959D3|Hspell:469327|h[Гигавзрыв]|h|r Галливикса подрывает их сразу же.\n$bullet;Когда |cFF2959D3|Hspell:469362|h[заряженная гигабомба]|h|r оказывается рядом с панелью гигауправления, происходит |cFF2959D3|Hspell:469767|h[взрыв гигабомбы]|h|r. Этот взрыв приводит к |cFF2959D3|Hspell:1220846|h[аварии системы управления]|h|r и выводит из строя |cFF2959D3|Hspell:469286|h[гигакатушки]|h|r Галливикса.\n$[15,16$bullet;Меткий караульный может нанести высокий урон |cFF2959D3|Hspell:466834|h[шоковым шквалом]|h|r, если ему не помешать.$]', 59888),
(30488, 'ruRU', 'Лекари', '$bullet;Когда эффект |cFF2959D3|Hspell:1220761|h[канистры механика]|h|r прекращает действовать или поглощается, происходит |cFF2959D3|Hspell:474447|h[взрыв канистры]|h|r.\n$bullet;Побежденные техники из картеля Мрачных Минеров оставляют гигабомбы, которые взрываются спустя $1223905D., после чего происходит |cFF2959D3|Hspell:1223905|h[ГигаБУМ!]|h|r. |cFF2959D3|Hspell:469327|h[Гигавзрыв]|h|r Галливикса подрывает их сразу же.\n$bullet;Когда |cFF2959D3|Hspell:469362|h[заряженная гигабомба]|h|r оказывается рядом с панелью гигауправления, происходит |cFF2959D3|Hspell:469767|h[взрыв гигабомбы]|h|r. Этот взрыв приводит к |cFF2959D3|Hspell:1220846|h[аварии системы управления]|h|r и выводит из строя |cFF2959D3|Hspell:469286|h[гигакатушки]|h|r Галливикса.\n$bullet;|cFF2959D3|Hspell:469286|h[Гигакатушки]|h|r, |cFF2959D3|Hspell:466338|h[хаотичные искряшки]|h|r и |cFF2959D3|Hspell:1214369|h[ТОТАЛЬНОЕ УНИЧТОЖЕНИЕ!!!]|h|r наносят высокий урон.', 59888),
(30487, 'ruRU', 'Танки', '$[15,16$bullet;|cFF2959D3|Hspell:465952|h[Большие бомбы с маленьким сюрпризом]|h|r и |cFF2959D3|Hspell:1214607|h[сногсшибательный взрыв]|h|r также создают |cFF2959D3|Hspell:466165|h[полутонные \"Ждуны\"]|h|r.$]\n$bullet;|cFF2959D3|Hspell:466340|h[Картечь-снаряды]|h|r и |cFF2959D3|Hspell:1214607|h[сногсшибательный взрыв]|h|r поражают игроков перед Галливиксом.\n$bullet;Побежденные техники из картеля Мрачных Минеров оставляют гигабомбы, которые взрываются спустя $1223905D., после чего происходит |cFF2959D3|Hspell:1223905|h[ГигаБУМ!]|h|r. |cFF2959D3|Hspell:469327|h[Гигавзрыв]|h|r Галливикса подрывает их сразу же.\n$bullet;По накоплении $1220290s2 эффектов |cFF2959D3|Hspell:1220290|h[Коварных выстрелов]|h|r или когда основная цель Галливикса меняется, он совершает все выстрелы.', 59888),
