(31173, 'ruRU', 'Смена фаз: боевая посадка', 'Галливикс обрушивается на площадку, превращая пораженный участок в подобие |cFF2959D3|Hspell:1214226|h[кратера]|h|r и получая |cFF2959D3|Hspell:1214229|h[обшивку класса \"Армагеддон\"]|h|r. После этого он применяет |cFF2959D3|Hspell:1214369|h[Тотальное уничтожение!!!]|h|r до тех пор, пока способность не будет прервана.', 59888),
