(30498, 'ruRU', 'Фаза 1: вот это арсенал!', '\"Если позволять другим на тебе ездить, твой барельеф в скале никто не высечет!\"\n\nГалливикс улучшает свой арсенал и начинает крушить противников.', 59888),
