(31956, 'ruRU', 'Бойцы', '$bullet;|cFF2959D3|Hspell:468846|h[Скачущие искры]|h|r преследуют игроков и оглушают их при попадании.\n$bullet;Электрические способности Гизла заряжают |cFF2959D3|Hspell:465279|h[воду из плотины]|h|r.\n$bullet;|cFF2959D3|Hspell:465463|h[Турбо-заряд]|h|r и |cFF2959D3|Hspell:468813|h[Гигабжик]|h|r наносят большой урон.', 59888),
(31102, 'ruRU', 'Танки', '$bullet; Рик применяет |cFF2959D3|Hspell:466128|h[резонанс]|h|r, наполняя мощью ближайшие усилители. \n$bullet; |cFF2959D3|Hspell:464488|h[Ультразвук]|h|r наносит звуковой урон в секторе перед боссом и вызывает у игроков |cFF2959D3|Hspell:464518|h[звон в ушах]|h|r. Звуковой урон нельзя блокировать или уменьшить с помощью брони.\n$bullet; |cFF2959D3|Hspell:466722|h[Разгон!]|h|r усилителей подбрасывает игроков в воздух, когда Рик применяет смертоносный |cFF2959D3|Hspell:467991|h[оглушительный дроп]|h|r.', 59888),
(30506, 'ruRU', 'Танки', '$bullet;|cFF2959D3|Hspell:466518|h[Кастет из расплавленного золота]|h|r наносит высокий урон целям перед Грабом и применяет к пораженным игрокам эффект |cFF2959D3|Hspell:467202|h[Капающее золото]|h|r.\n$bullet;Урон от |cFF2959D3|Hspell:469490|h[двойного мощного выстрела]|h|r уменьшается за счет ближайшего пораженного игрока.', 59888),
(30486, 'ruRU', 'Обзор', 'Галливикс постепенно накапливает энергию и активирует |cFF2959D3|Hspell:469286|h[гигакатушки]|h|r Хромового дома, получив максимальный заряд. Когда |cFF2959D3|Hspell:469362|h[заряженная гигабомба]|h|r оказывается рядом с панелью гигауправления, происходит |cFF2959D3|Hspell:469767|h[взрыв гигабомбы]|h|r. Этот взрыв приводит к |cFF2959D3|Hspell:1220846|h[аварии системы управления]|h|r и выводит из строя |cFF2959D3|Hspell:469286|h[гигакатушки]|h|r Галливикса. Когда обе панели гигауправления уничтожают, появляется |cFF2959D3|Hspell:1215209|h[аварийная зона]|h|r.\n\nКроме того, на протяжении боя Галливикс призывает на помощь самых высокооплачиваемых приспешников из картеля Мрачных Минеров.\n\nВо время битвы Галливикс маниакально меняет и совершенствует свой арсенал, делая его все более разрушительным.$[14,15,17$ Когда уровень здоровья Галливикса падает до 50%, он улучшает свои способности, чтобы уничтожить игроков раз и навсегда. $]', 59888),
(30082, 'ruRU', 'Лекари', '$bullet;Если во время |cFF2959D3|Hspell:461060|h[Победоносного кружения!]|h|r игроки не вставляют два жетона или выбирают ранее выпавшую комбинацию, однорукий бандит применяет способность |cFF2959D3|Hspell:461068|h[Обнаружено мошенничество!]|h|r.\n$bullet;|cFF2959D3|Hspell:460164|h[Гнусный выхлоп]|h|r снижает скорость передвижения игроков и поглощает большое количество исцеления.\n$bullet;Персонажи, находящиеся рядом с фишкой |cFF2959D3|Hspell:460181|h[Выигрышной линии]|h|r, получают эффект |cFF2959D3|Hspell:460444|h[Азартный игрок!]|h|r.', 59888),
(31381, 'ruRU', 'Раздел 45', '', 59888),
(31380, 'ruRU', 'Раздел 44', '', 59888),
(30951, 'ruRU', 'Лекари', '$bullet;Если тикающие часовые бомбы, созданные способностью |cFF2959D3|Hspell:460867|h[Большой БА-БАХ!]|h|r, не обезвредить за отведенное время, они наносят игрокам высокий урон.\n$bullet;|cFF2959D3|Hspell:459779|h[Пробивной рывок]|h|r Бронта поражает все цели на его пути, в том числе тикающие часовые бомбы, созданные способностью |cFF2959D3|Hspell:460867|h[Большой БА-БАХ!]|h|r.\n$bullet;$[8,23|cFF2959D3|Hspell:473690|h[Кинетический взрыв-гель]|h|r при рассеивании подбрасывает вверх находящиеся рядом тикающие часовые бомбы.$]', 59888),
(30950, 'ruRU', 'Танки', '$bullet;Если тикающие часовые бомбы, созданные способностью |cFF2959D3|Hspell:460867|h[Большой БА-БАХ!]|h|r, не обезвредить за отведенное время, они наносят игрокам высокий урон.\n$bullet;|cFF2959D3|Hspell:459779|h[Пробивной рывок]|h|r Бронта поражает все на его пути, в том числе тикающие часовые бомбы, созданные способностью |cFF2959D3|Hspell:460867|h[Большой БА-БАХ!]|h|r.', 59888),
(30949, 'ruRU', 'Бойцы', '$bullet;Если тикающие часовые бомбы, созданные способностью |cFF2959D3|Hspell:460867|h[Большой БА-БАХ!]|h|r, не обезвредить за отведенное время, они наносят игрокам высокий урон.\n$bullet;|cFF2959D3|Hspell:459779|h[Пробивной рывок]|h|r Бронта поражает все цели на его пути, в том числе тикающие часовые бомбы, созданные способностью |cFF2959D3|Hspell:460867|h[Большой БА-БАХ!]|h|r.\n$bullet;$[8,23|cFF2959D3|Hspell:473690|h[Кинетический взрыв-гель]|h|r при рассеивании подбрасывает вверх окружающие тикающие часовые бомбы.$]', 59888),
(18928, 'ruRU', 'Раздел 17', '', 59888),
(18914, 'ruRU', 'Раздел 8', '', 59888),
(18455, 'ruRU', 'Раздел 13', '', 59888),
(31258, 'ruRU', 'Раздел 20', '', 59888),
(31257, 'ruRU', 'Раздел 21', '', 59888),
(31132, 'ruRU', 'Бойцы', '$bullet;|cFF2959D3|Hspell:473959|h[Вытягивание души]|h|r Кул\'тарок вырывает души из тел игроков. Если души достигают Кул\'тарок, она наполняет их некротической энергией и вызывает |cFF2959D3|Hspell:474013|h[порчу души]|h|r.\n$bullet; |cFF2959D3|Hspell:1216474|h[Виток смерти]|h|r создает кружащую сферу некромантии, которая наносит пораженным игрокам урон от темной магии.', 59888),
(28414, 'ruRU', 'Обзор', 'Хмелевар Алдрир использует взрывоопасный искрохмель, атакуя игроков с помощью |cFF2959D3|Hspell:432198|h[Пламенной отрыжки]|h|r и |cFF2959D3|Hspell:432182|h[Броска искрохмеля]|h|r.\n\nКогда у хмелевара Алдрира остается 66% и 33% здоровья, он начинает |cFF2959D3|Hspell:442525|h[Счастливый час]|h|r, и томимые жаждой посетители издают |cFF2959D3|Hspell:431896|h[Буйный крик]|h|r.', 59888),
(22652, 'ruRU', 'Бойцы', '$bullet;|cFF2959D3|Hspell:333292|h[Огненная смерть]|h|r наносит урон окружающим союзникам.\n$bullet;Накопив 100 ед. энергии, Пакиран выстреливает в игроков |cFF2959D3|Hspell:320182|h[гибельными спорами]|h|r.', 59888),
(22650, 'ruRU', 'Танк', '$bullet;|cFF2959D3|Hspell:320069|h[Смертельный удар]|h|r ослабляет получаемое исцеление.\n$bullet;Накопив 100 ед. энергии, Пакиран выстреливает в игроков |cFF2959D3|Hspell:320182|h[гибельными спорами]|h|r.', 59888),
