(21580, 'ruRU', 'Бойцы', '$bullet;Побежденный претендент передает остальным претендентам свою |cFF2959D3|Hspell:1215747|h[последнюю волю]|h|r.\n$bullet;|cFF2959D3|Hspell:333292|h[Огненная смерть]|h|r наносит урон окружающим союзникам.\n$bullet;Накопив 100 ед. энергии, Пакиран выстреливает в игроков |cFF2959D3|Hspell:320182|h[гибельными спорами]|h|r.', 59888),
(21579, 'ruRU', 'Лекарь', '$bullet;|cFF2959D3|Hspell:320069|h[Смертельный удар]|h|r ослабляет получаемое исцеление.\n$bullet;|cFF2959D3|Hspell:333292|h[Огненная смерть]|h|r наносит урон окружающим союзникам.\n$bullet;|cFF2959D3|Hspell:1215600|h[Иссушающее прикосновение]|h|r наносит целям периодический урон от темной магии, пока эффект не будет снят.', 59888),
(21577, 'ruRU', 'Обзор', 'Проявите себя, победив всех трех претендентов. Каждый из них владеет мощной способностью, которую применяет, накопив 100 ед. энергии.', 59888),
(19233, 'ruRU', 'Танки', '$bullet;Принесите \"Платиновый лупцеватор\" в зону действия |cFF2959D3|Hspell:282943|h[таранных поршней]|h|r, чтобы снять эффекты |cFF2959D3|Hspell:282801|h[платиновой обшивки]|h|r', 59888);
