INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2345, 'ruRU', 'Пухочай микси', '|cFFFFD200Внутриигровой магазин|r|n', 'Пухочаи славятся умением заваривать ароматный чай – но они такие игривые, что вечно проливают его на землю.', 59888),
(2344, 'ruRU', 'Покатун микси', '|cFFFFD200Внутриигровой магазин|r|n', 'Покатуны гордятся тем, что им доверяют разносить чай. Они готовы в любой момент предложить спутникам чашечку теплого напитка.', 59888),
(2343, 'ruRU', 'Мягколап микси', '|cFFFFD200Внутриигровой магазин|r|n', 'Мягколапы приносят черный чай, идеально бодрящий с утра и помогающий не уснуть поздним вечером.', 59888),
(2342, 'ruRU', 'Лохмошерст микси', '|cFFFFD200Внутриигровой магазин|r|n', 'Лохмошерсты игривые, неуклюжие и безумно чистоплотные. Небезопасное сочетание.', 59888),
(2489, 'ruRU', 'Перламутровая бабочка', '|cFFFFD200Торговая лавка|r', 'Взмойте ввысь на этой сияющей бабочке с крыльями, мерцающими словно жемчуг.', 59888),
(2288, 'ruRU', 'Персональный гоблинский сборщик ХЛАМа', '|cFFFFD200Источник:|r куча просеянного хлама|n|cFFFFD200Зона:|r Нижняя Шахта', 'Гоблинские крошшеры – весьма универсальные машины, полезные для самых разных видов деятельности: от вырубки леса до транспортировки. Эта модель была изменена и доработана для нужд ХЛАМа.', 59888),
(2346, 'ruRU', 'Чаекрад микси', '|cFFFFD200Внутриигровой магазин|r|n', 'Хотя эти создания от природы игривы и проказливы, из них получаются верные и надежные спутники.', 59888),
(2296, 'ruRU', 'Вездешлямзель для вылазок', '|cFFFFD200Локальное задание: |r\"Верните мне шляпу\"|n|cFFFFD200Зона: |rостров Дорн|n|cFFFFD200Зона: |rДорногал', 'Этот воздушный транспорт доставит вас прямо к приключениям, если не взорвется раньше!', 59888),
(2279, 'ruRU', 'Громосбойная ракета', '|cFFFFD200Торговец: |rАндо Пуля|n|cFFFFD200Зона: |r\"Освобождение Нижней Шахты\"|n|cFFFFD200Цена: |r500|TINTERFACE\\MONEYFRAME\\UI-GOLDICON.BLP:0|t', 'Ее нашли на трибунах котла смерти после одной особенно жестокой битвы. Когда оператора Крутня спросили, обезврежена ли она, он пожал плечами и ответил: \"Ну... наверное\".', 59888),
(2276, 'ruRU', 'Хламоглот Мрачных Минеров', '|cFFFFD200Торговец: |rАндо Пуля|n|cFFFFD200Зона: |r\"Освобождение Нижней Шахты\"|n|cFFFFD200Цена: |r500|TINTERFACE\\MONEYFRAME\\UI-GOLDICON.BLP:0|t', 'Вожак гиен со свалки Стикса. Челюсти у него страх какие мощные и раздробят что угодно. Или кого угодно. Тут уж как пожелает Галливикс.', 59888),
(1471, 'ruRU', 'Отмщение', '|cFFFFD200Источник:|r леди Сильвана Ветрокрылая|n|cFFFFD200Зона:|r Святилище Господства|n|cFFFFD200Режим:|r эпохальный', 'В тот день, когда Артас лишил Сильвану жизни, она потеряла часть своей души, и образовавшуюся пустоту заполнила тьма.', 59888);
